#!/usr/bin/env -S deno run -A
/** # Files Module
  * This module is responsible in handling embedded files such that the compiled output requires no other files. Embed a file by typing:
  * ```sh
  * ./src/files.ts fileA fileB >> src/files.ts
  * ```
  * @module
  */
import { contentType } from "https://deno.land/std@0.224.0/media_types/mod.ts";

/** All embedded files */
export const files:File[] = [];
/** Embedded file class */
export class File {
    constructor(type:string, path:string, data:string) {
        this.type = type;
        this.path = path;
        this.data = Uint8Array.from(atob(data), c => c.charCodeAt(0));
        files.push(this);
    }
    /** Mime */
    type:string;
    /** Path to file *(also indicates server's route to file)* */
    path:string;
    /** Raw data of file */
    data:Uint8Array;
    /** Serves the file if HTTP is requesting it */
    serve(req:Request):Response|null {
        return File.serve(req, [this]);
    }
    /** Returns either:
      * - `server's path to file` - If web
      * - `base64 data url` - If not web
      */ 
    file(web:boolean):string {
        if (web) return this.path;
        return `data:${this.type};base64,${btoa(String.fromCharCode(...this.data))}`;
    }
    /** Serves one/more/all the files to HTTP Request has HTTP Response if requested */
    static serve(req:Request, fs=files):Response|null {
        const path = new URL(req.url).pathname;
        for (const file of fs)
            if (path == file.path)
                return new Response(file.data, {headers:{'content-type':file.type}});
        return null;
    }
}

/* ----- EMBEDDING SCRIPT ----- */
if (import.meta.main) {
    for (const file of Deno.args) {
        const name_var = (/([^\/.]+)\.[^\/.]+$/.exec(file)??['','unknown'])[1];
        console.log(`// ${file}\nexport const ${name_var} = new File('${contentType(file)}','/${file}','${btoa(String.fromCharCode(...(await Deno.readFile(file))))}');\n`);
    }
    Deno.exit();
}

/* ----- FILES (Disable Word Wrap) ----- */

